(function() {
    'use strict';
    angular
        .module('orange.controller.base', [])
        .controller('BaseCtrl', Controller);

    Controller.$inject = ['$rootScope', '$scope', '$state', 'authService', 'SessionsFactory', 'Config', 'ErrorsFactory'];

    function Controller($rootScope, $scope, $state, authService, SessionsFactory, Config, ErrorsFactory) {
        var vm = this;

        init();

        function init() {
            $scope.session = SessionsFactory.session.session;
            $scope.config = Config;
            $scope.errorCollection = ErrorsFactory.errorCollection;
            vm.data = {
                forms: {
                    login: {
                        username: '',
                        password: ''
                    }
                }
            };
            console.log('Loading base controller');

            SessionsFactory.profile();
        }

        $rootScope.$on('event:auth-loginRequired', function(events, msg) {
            SessionsFactory.logout();
            showLogin();
        });

        $rootScope.$on('event:auth-loginConfirmed', function (events, msg){
            hideLoginModal();
        });

        function showLogin() {
            $(function() {
                if($state.current.name != "app.simple.register")
                    $('#login').openModal();
            });
        }

        function hideLoginModal() {
            $(function() {
                $('#login').closeModal();
            });
        }

        $scope.register = function () {
            hideLoginModal();
            $state.go('app.simple.register');
        }

        $scope.login = function() {
            SessionsFactory.login(vm.data.forms.login).then(function(res) {
                vm.data.forms.login = {};
                authService.loginConfirmed();
                hideLoginModal();
            }, function(err) {
                console.log(err);
            });
        }

        $scope.logout = function() {
            $rootScope.$broadcast('event:auth-loginRequired');
        }
    }
})();

(function() {
    'use strict';

    angular
        .module('orange.controller.chat', [])
        .controller('ChatCtrl', Controller);

    Controller.$inject = ['$scope', 'SocketFactory']

    function Controller($scope, socket) {
        var vm = this;

        init();

        function init() {
            console.log('Loading the chat controller');
        }

        var typingTimer;
        var typing = false;
        var doneTypingInterval = 1000;
        var $input = $('#m');

        $(document).ready(function() {
            $(document).keypress(function(e) {
                if (e.which == 13) {
                    doneTyping();
                }
            });
            $('form').submit(function() {
                socket.emit('chat:message', $('#m').val());
                $('#m').val('');
                return false;
            });

            socket.on('chat:message', function(msg) {
                $('#messages').append($('<li>').text(msg));
            });

            socket.on('chat:typing', function() {
                $('#typing').text('A user is typing');
            });

            socket.on('chat:typing-stopped', function() {
                $('#typing').text('');
            });

            //on keyup, start the countdown
            $('#m').keyup(function() {
                clearTimeout(typingTimer);
                socket.emit('chat:typing');
                typingTimer = setTimeout(doneTyping, doneTypingInterval);
            });

            //on keydown, clear the countdown 
            $('#m').keydown(function() {
                socket.emit('chat:typing');
                clearTimeout(typingTimer);
            });

            //user is "finished typing," do something
            function doneTyping() {
                socket.emit('chat:typing-stopped');
            }
        });
    }
})();

